import Fetch from 'isomorphic-unfetch';
import Link from 'next/link';

const News = props => (
  <div>
    {props.newsList.articles.map((e, index) => (
      <div key={index}>
        <p class="text-justify">
          <strong>Title:</strong> <i class="bx bx-tada bxl-whatsapp"></i>{' '}
          {e.title}
          <br />
          <strong>
            Author:
          </strong> <i class="bx bx-tada bxs-phone-call"></i> {e.author}
          <br />
          <strong>Description:</strong> <i class=""></i> {e.description}
          <br />
        </p>
      </div>
    ))}
  </div>
);
export default News;
